@fugitivenanachi GPUは、大量の同じ計算式の計算を、爆速でこなすコンピュータとも言えるのだ
GTX1650を例に出すと、CPU 1.5GHz 896コア、メモリ4GBなコンピュータなのだ
ポイントは、同じ計算式の計算を並列で処理してるところなのだ。CPUでも出来るけど、並列化に向いてないのでどーしても遅くなるのだ。

